import React, { Component } from 'react';
import './archives.css';

class Home extends Component {
  render() {
    return (
    <div>
      <select name="cars">
      <option value="volvo">Volvo</option>
      <option value="saab">Saab</option>
      <option value="fiat">Fiat</option>
      <option value="audi">Audi</option>
    </select>
    </div>
    );
  }
}

export default Home;
